import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { throwError } from 'rxjs';
import { catchError } from 'rxjs/operators';
import { AppsettingService } from '../../Common/appsetting.service';
import { EmitraRequestDetails } from '../../Models/PaymentDataModel';
import { StudentSearchModel } from '../../Models/StudentSearchModel';

@Injectable({
  providedIn: 'root'
})
export class EmitraPaymentService {
  readonly APIUrl = this.appsettingConfig.apiURL + "EmitraPaymentService";
  readonly headersOptions: any;
  constructor(private http: HttpClient, private appsettingConfig: AppsettingService)
  {
    this.headersOptions = {
      headers: new HttpHeaders({
        'Content-Type': 'application/json',
        'Authorization': 'Bearer ' + localStorage.getItem('authtoken')
      })
    };
  }
  extractData(res: Response) {
    return res;
  }
  handleErrorObservable(error: Response | any)
  {
    return throwError(error);
  }

  public async EmitraPayment(request: EmitraRequestDetails)
  {
    const headers = { 'content-type': 'application/json' }
    const body = JSON.stringify(request);
    return await this.http.post(this.APIUrl + "/EmitraPayment", body, { 'headers': headers })
      .pipe(
        catchError(this.handleErrorObservable)
      ).toPromise();
  }


  public async GetEmitraTransactionDetails(PRnNO?: string)
  {
    const httpOptions = {
      headers: new HttpHeaders({
        'Content-Type': 'application/json'
      })
    };
    return await this.http.get(this.APIUrl + "/GetEmitraTransactionDetails/" + PRnNO)
      .pipe(
        catchError(this.handleErrorObservable)
      ).toPromise();
  }



  public async GetTransactionDetailsActionWise(request: StudentSearchModel)
  {
    const headers = { 'content-type': 'application/json' }
    const body = JSON.stringify(request);
    return await this.http.post(this.APIUrl + "/GetTransactionDetailsActionWise", body, { 'headers': headers })
      .pipe(
        catchError(this.handleErrorObservable)
      ).toPromise();
  }

}
